(27, 'new employee tools', '<p>Company Name: TLCI</p><p>Location: BINAN</p><p>First Name: WELMER</p><p>Middle Initial: C.</p><p>Surname:TADIOSA</p><p>Position: ENGINEERING SUPERVISOR</p><p>Department: GSD</p><p>Business Unit: GSD</p><p>Starting Date: March 31</p><p>Need Laptop? YES</p><p>Need Cellphone? YES</p><p>Need SAP Account? YES</p><p>Replacement? YES</p><p>Replacement of whom? ERWIN VERGARA</p><p>Additional Headcount? NO</p>', '2025-03-31', '2025-03-25', '2025-04-04', 5, 6, 2, 93, '2025-03-25 10:46:40', NULL, NULL, '84', 3, 2, 2, 0, NULL, NULL, 'SRN:2025032503464018', '<p>Tools issued ito yung nawala.</p>'),
