(33, '272 New Employee Trade of Tools', '<p>Lorainne May B. Tejada</p><p>Company Name: TLCI</p><p>Location: SM NORTH EDSA</p><p>First Name: GILBERT</p><p>Middle Initial: L.</p><p>Surname: ASPILI</p><p>Position: Store Supervisor</p><p>Department: Retail</p><p>Business Unit: Commercial</p><p>Starting Date: Jan 6, 2024</p><p>Need Laptop? YES</p><p>Need Cellphone? YES</p><p>Need SAP Account? YES</p><p>Replacement? NO</p><p>Replacement of whom? NA</p><p>Additional Headcount?</p><p>This is a transfer / promotion, from store crew to store supervisor</p><p>2.12.2025: laptop-issued. phone requested-included to 19 units.</p><p>&nbsp;</p>', '2025-04-03', '2024-12-19', '2025-04-11', 5, 6, 2, 84, '2025-03-25 11:46:14', NULL, NULL, '84', 3, 2, 1, 0, NULL, NULL, 'SRN:2025032504461424', '<p>will close this ticket, have created a new ticket assignment.</p>'),
(34, '276 ACER LAPTOP CHARGER NOT CHARGING', '<p>John Patrick G. Barril</p><p>1.31.2025-need to check his defective charger, bumili sya ng bagong charger 300 pesos ang bili hindi na daw nya irereimburse.</p><p>2.11.2025: email sent - Good afternoon! A gentle follows up on this. We need to check the defective charger and your current charger. When you go to LTI IC Plant, please drop by in the head office for checking of the said laptop charger. Thank you.&nbsp;</p><p>2.12.2025: JFFELIX-Email sent: Hello JP, As per our conversation thru viber, since your scheduled to LTI CB Ice Cream plant tomorrow,&nbsp; you will try to drop by here in the head office for checking of your laptop chargers.</p><p>3.25.2025: need to replace the defective charger-petty cash requested.</p><p>&nbsp;</p>', '2025-04-02', '2024-12-23', '2025-03-31', 5, 6, 2, 84, '2025-03-25 11:58:19', NULL, NULL, '84', 3, 3, 1, 0, NULL, NULL, 'SRN:2025032504581925', NULL),
(35, '286 Request for Email add-LPCATUBIG', '<p>01/08/25: PR Created. PR-IT-241007</p><p>2.12.2025: RE: PR for BMC MSO 365 (PR-IT-241007)</p><p>2.12.2025: Hi Miss Mia,</p><p>Good afternoon! A gentle reminder about PR-IT-241007 &ndash; MSO 365 Business Standard for:</p><p>1. Crystal Kane A. Jabiguero-Talent Acquisition Staff</p><p>2. Ella Mae T. Buenafe-Employee Relations Staff</p><p>3. Rica M. As-ason-Payroll and CompenBen Staff</p><p>4. Lendie P. Catubig-HR Head</p><p>Please see the attached file for your reference. Thank you.</p><p>&nbsp;</p>', '2025-04-04', '2025-01-06', '2025-05-07', 4, 6, 2, 84, '2025-03-25 13:05:05', NULL, NULL, '84', 3, 2, 1, 0, NULL, NULL, 'SRN:2025032506050526', '<p>Email accounts are created.</p><p>&nbsp;</p>'),
(36, '288 Request for replacement of Laptop Charger | Laptop charger is currently not working', '<p>Mark Kelvin R. Gapunay</p><p>01/08/25: naemail ko na ito, waiting for the next step.&nbsp;</p><p>01/16/2025: Battery-hindi na under warranty, waiting sa quotation, need follow up.</p><p>2.10.2025: JFFELIX- Good afternoon! When is delivery date of PO5800001825?</p>', '2025-04-11', '2025-01-06', '2025-03-28', 4, 6, 2, 84, '2025-03-25 13:09:13', NULL, NULL, '84', 3, 3, 1, 0, NULL, NULL, 'SRN:2025032506091327', NULL),
(37, 'UHDFI - Packet Tracer - Network Plan ', '<p><a href=\"https://tlci2022-my.sharepoint.com/:u:/g/personal/kpmarasigan_carmensbest_com_ph/ERqxJd0h-0xDlxbpEjg2uNcBElVnuBEBv73dvxYJQsVfiw?e=TF1Oit\">UHDFI-network.pkt</a><br />*Double click this hyperlink to redirect to file link.</p>', '2025-03-25', '2025-03-25', '2025-04-02', 1, 6, 3, 85, '2025-03-25 13:56:00', NULL, NULL, '85', 6, 2, 1, 0, NULL, NULL, 'SRN:2025032506560028', NULL),
(38, 'Router in Binan QA Lab', '<p>There is very poor signal in Binan QA lab, thus communication is very difficult esp at night when there is only one analyst on duty.&nbsp; They have to go back and forth to the laboratory and upstairs in the office.</p><p>Communication is crucial at 12mn and 3am where we do releasing of products.&nbsp; They communicate with me during those times when i am at home, I verify and authorize the release and rejection of products.</p><p>It is also during those times that said analyst&nbsp;is&nbsp;multi tasking (cooking, weighing, testing and documenting).</p><p>In Bay QA lab, we are provided with a&nbsp;router.</p>', '2025-03-31', '2025-03-28', '2025-04-11', 2, 6, 2, 103, '2025-03-25 14:04:36', NULL, NULL, '84', 3, 2, 2, 0, NULL, NULL, 'SRN:2025032507043629', '<p>Created in assignment as mini project.</p>'),
