(42, 'CP for R&D supervisor', '<p>Requesting for issuance of CP for Angelyn Subil who is currently using her personal phone in communicating/responding with suppliers, marketing and operations personnel.&nbsp; She has no Cphone plan, and can&#39;t be reached when needed.&nbsp;&nbsp;</p><p>Most of the calls are about raw and packaging materials, new idea or follow up on a new formula and&nbsp;&nbsp;request for samples from marketing.</p>', '2025-03-25', '2025-03-27', '2025-05-07', 4, 6, 2, 103, '2025-03-25 14:22:42', NULL, NULL, '84', 4, 2, 2, 0, NULL, NULL, 'SRN:2025032507224233', '<p>Admin:<br />Hi Ms. Weng, since we haven&#39;t heard from you since the last update. We will now close this ticket. If you need to reopen this, feel free to reopen or create a new ticket.</p><p>Thank you!</p>'),
