(122, 'Microsoft Edge is linked to another account', '<p>Hi! I would like to know if I am sharing an account with Ms. Myra Abad? I think syncing MS edge accounts caused this. If so could I have my functions separate with hers or have a separate account totally?</p><p>My MS edge bookmarks contained a lot of monitoring files and this affected most of my processing functions because I lost all my monitoring bookmarks.</p><p>Is there a way to restore them? Please let me know as soon as you can, thank you!</p>', '2025-04-11', '2025-04-04', '2025-04-14', 4, 6, 2, 117, '2025-04-03 13:32:05', NULL, NULL, '85', 3, 2, 2, 0, NULL, NULL, 'SRN:2025040307320599', '<p>I suggested that to separate the list of her bookamrks because the old bookmark history is completely wiped and cannot be recovered.</p>'),
