(272, 'PLDT Wifi Application and Installation in Cebu Depot UHDFI', '<p>Dear Management,</p><p>Good day.</p><p>I would like to inform you that our current internet connection at the Cebu Depot, which is under CONVERGE, is about to be terminated. Based on a recent phone conversation with Mr. Christian from Universal Harvester Inc., he clarified that this account is not under Universal Harvester Dairy Farms Inc. As such, the termination may take effect anytime within this month of May 2025.</p><p>To ensure continuity of our operations, I am preparing to apply for a new provider which is PLDT through their hub in Mandaue City, Cebu. This step is being taken proactively to avoid any disruption in our internet services.</p><p>Additionally, Sir Dante and Sir Ely, if you have any suggestions or contacts that might help expedite the PLDT application process, I would greatly appreciate your support.</p><p><br /><!--[if !supportLineBreakNewLine]--><br /><!--[endif]--></p>', '2025-05-16', '2025-05-07', '2025-05-30', 5, 6, 3, 155, '2025-05-07 16:25:59', NULL, NULL, '84,85', 6, 2, 2, 0, NULL, NULL, 'SRN:20250507102559249', '<p>Internet is now activated and tested.</p>'),
