(616, 'Touchpad still not working, audio still does not work for time to time', '<p>Even if initial fixes were done last week for my audio, I encountered the same problems yesterday and today. Yesterday, it happened during my first meeting of the day and did not get resolved. Today, it happened at another meeting and I needed to restart.&nbsp;</p><p>&nbsp;</p><p>For my touchpad, it has completely stopped working. Before, the function to click on things was not working. Now, the cursor really does not move anymore when I try using the touchpad.&nbsp;I cannot use my laptop without a mouse, which is challenging especially when on-the-go or working in different venues.</p>', '2025-07-07', '2025-07-11', '2025-08-05', 3, 6, 3, 186, '2025-07-05 09:10:19', NULL, NULL, '84', 3, 2, 2, 0, NULL, NULL, 'SRN:20250705031019593', '<p>Have replaced the laptop:</p><p>former laptop:&nbsp;<span style=\"color:#323130; font-family:&quot;Segoe UI&quot;,&quot;Segoe UI Web (West European)&quot;,&quot;Segoe UI&quot;,-apple-system,BlinkMacSystemFont,Roboto,&quot;Helvetica Neue&quot;,sans-serif'),
(617, 'failed to connect to wifi network', '<p>Wifi network i used to be connected with is gone and I&nbsp;do not know the password to the available wifi networks. I&#39;m requesting for the wifi password to any of the following: TLCICB; TLCICB_5G</p>', '2025-07-07', '2025-07-25', '2025-07-25', 4, 6, 3, 147, '2025-07-06 10:28:16', NULL, NULL, '84', 3, 3, 2, 0, NULL, NULL, 'SRN:20250706042816594', '<p>As per checking she is able to connect on wifi.</p>'),
