(1300, 'PR doesn\'t have a release strategy', '<p>Marj of Procurement flagged that the past two PRs I have filed doesn&#39;t have a release strategy. I sent the PR# to the designated approver but she cannot find the PR# in her SAP approvals.&nbsp;</p>', '2025-10-13', '2025-10-14', '2025-10-20', 3, 6, 3, 364, '2025-10-13 13:48:56', NULL, NULL, '84', 3, 2, 2, 0, NULL, NULL, 'SRN:202510130748561277', 'Kindly re-PRHI Miss@RPTEJADAkindly re-PR AGRIVERSE:Purchase requisition number 5000003121ENDERUN:Purchase requisition number 5000003122we will tag this task as close. kindly create a ticket if you have other concern.'),
(1301, 'Request for Laptop Replacement', '<p>Hi Sir,</p><p>Sir Vee Jay has already emailed Sir Austine regarding this concern, and you may refer to the attached file for reference. I am filing this ticket as instructed by Sir Austine.</p><p>I would like to clarify and provide context regarding my current work setup and practices:</p><p><strong>Web Browser Usage</strong><br />I only open one web browser at a time, and in many cases, I do not open any browser unless necessary for work-related tasks. This is done intentionally to minimize system resource usage.</p><p><strong>Excel Windows/Tabs</strong><br />It is essential for me to open multiple Excel windows simultaneously. This allows me to efficiently transfer, copy, and compare data across different files, which is a critical part of my daily responsibilities. Restricting this would significantly affect productivity and accuracy.</p><p><strong>Laptop Shutdown Procedure</strong><br />I always ensure that the laptop is properly shut down at the end of each workday. I do not leave it idle or simply fold it overnight.</p><p><strong>Excel File Optimization</strong><br />While I understand the concern regarding file size, the formulas embedded in the Excel files are necessary for traceability. These formulas help us track the origin of data inputs and provide clear explanations when queries arise from management or auditors. Removing these formulas solely to reduce file size would compromise the integrity and auditability of the data.</p><p><strong>Laptop Replacement Consideration</strong><br />Given the nature of my tasks&mdash;which involve handling multiple Excel files, performing SAP entries, and managing recurring financial processes&mdash;a laptop with higher specifications would be a more sustainable and effective solution. While optimizing files and limiting system usage may offer temporary relief, these do not address the root cause: the current device may no longer be sufficient to support the workload efficiently.&nbsp;</p><p>We are open to sharing the actual Excel files for further evaluation, should your team wish to assess the formula structure and optimization opportunities.</p><p>Hoping for a positive response and support on this matter. Thank you very much for your time and consideration.</p><p>&nbsp;</p><p>Best regards,<br /><strong>Sednyl Andrie B. Eugenio</strong></p>', '2025-10-13', '2025-10-14', '2025-10-15', 4, 6, 3, 170, '2025-10-13 14:07:45', NULL, NULL, '85', 12, 1, 2, 0, NULL, NULL, 'SRN:202510130807451278', 'Deployed a laptop, still under monitoring for performance efficency of the laptop, runs a script every morning up until 5pm.'),
