(1441, 'Laptop Printer Connection, Epson L5290', '<p>John Lenard Martin</p><p>Subject: Laptop Printer Connection, Epson L5290</p><p>Project: Support/maintenance</p><p>Description: Laptop Printer Connection, Epson L5290</p>', '2025-11-03', '2025-11-03', '2025-11-05', 4, 6, 2, 386, '2025-11-05 11:39:01', NULL, NULL, '383', 13, 2, 2, 0, NULL, NULL, 'SRN:202511050439011398', 'Connect the laptop and printer on the same network. So they see and connect to one another'),
(1442, 'Laptop Epson L5290 Software installation', '<p>John Lenard Martin</p><p>Subject: Laptop Epson L5290 Software installation</p><p>Project: Support/maintenance</p><p>Description: Want&nbsp; to connect Sir. Martin&#39;s laptop to the Epson L5290 wirelessly.</p>', '2025-11-03', '2025-11-03', '2025-11-05', 4, 6, 2, 386, '2025-11-05 11:41:04', NULL, NULL, '383', 13, 2, 2, 0, NULL, NULL, 'SRN:202511050441041399', 'Connect the printer using the WI-Fi setup wizard in its panel and also updated the firmware. Then the laptop installed Epson Utility for Epson L5290 so that the software can control and access the printer wirelessly.'),
(1443, 'BP Creation - Vendor creation in SAP (SKS Marketing)', '<p>&nbsp;</p><p>Good day. Request for BP creation</p><p>Vendor Name: SKS MARKETING</p><p>Address: Juarez St. C.M. Recto Street, Brgy. 6 Poblacion, Lucena City 4301</p><p>TIN: 162-034-607-00000</p><p>Payment Term: 15 days (NT15)</p><p>Currency: PHP&nbsp;</p><p>&nbsp;</p>', '2025-11-06', '2025-11-05', '2025-11-05', 5, 6, 3, 165, '2025-11-05 13:17:25', NULL, NULL, '85', 3, 3, 2, 0, NULL, NULL, 'SRN:202511050617251400', 'BP CODE:1000051008 - SKS MARKETING / 4301 LUCENA CITY'),
