(1459, 'BARCODE CREATION FOR FINISHED GOODS', '<p>Hi Ken,<br /><br />Please help our operations team in creating barcode for our finished goods.<br />We would like the ff:<br /><br />1. We will be using our smartphones to scan. Please suggest an app to use.<br />2. Once scan, we kindly request that information will be saved in an excel file.<br />3. Let us know if you can add/give suggestions on barcoding system that we would like to introduce.<br /><br />Thanks!</p>', '2025-11-07', '2025-11-07', '1900-01-01', 4, 3, 3, 187, '2025-11-07 11:19:31', NULL, NULL, '383', 13, 0, 2, 0, NULL, NULL, 'SRN:202511070419311416', NULL),
(1460, 'OT FILING ERROR', '<p>One of our employee, John Carlo Biole OT filing was success but it does not save or I do not receive his OT for approval for only Nov.4. The other OT filing for Nov 5 onwards are working fine, I was able to approved but only Nov.4 was the issue.</p>', '2025-11-07', '1900-01-01', '1900-01-01', 3, 1, 3, 114, '2025-11-07 15:22:08', NULL, NULL, NULL, 4, 0, 2, 0, NULL, NULL, 'SRN:202511070822081417', NULL);
